package org.blue.learning.leetcode.day23;

/**
 * @author leiyi
 * @date 2016-11-03 10:55
 * @summary:ImplementstrStr
 */
public class ImplementstrStr {

    public static void main(String[] args) {
        String s = "\"\"\n" +
                "\"\"";
        System.out.println(strStr(s, ""));
    }

    /**
     * kmp算法
     * @param haystack
     * @param needle
     * @return
     */
    public static int strStr(String haystack, String needle) {
        if (haystack == null || needle == null) {
            return -1;
        }
        if (haystack.equals(needle)) {
            return 0;
        }
        int index;
        int haystackIndex = 0;
        int result = -1;
        int temp;
        for (; haystackIndex < haystack.length(); haystackIndex ++) {
            index = 0;
            temp = haystackIndex;
            while (index < needle.length() && temp < haystack.length() && needle.charAt(index) == haystack.charAt(temp)) {
                index ++;
                temp ++;
            }
            if (index == needle.length()) {
                return haystackIndex;
            }
        }

        return result;
    }
}
